import { Container } from "@material-ui/core";

import TodoCard from "./TodoCard";

function AllTodos() {
  return (
    <section>
      <Container>
        <h1>Your All todos are here</h1>

        <TodoCard />
      </Container>
    </section>
  );
}

export default AllTodos;
